    <div>
        <button id="play">Play</button>
        <button id="pause">Pause</button>
        <button id="speedBackward">5X backwards</button>
        <button id="speedForward">5X forwards</button>
        <select id="performerMenu" name="Performer" autocomplete="off">
            <option value="allParts" selected>All Parts</option>
            <option value="bassPerformer">Bass</option>

            <option value="performer2">Violin 2</option>

            <option value="performer4">Cello</option>

        <button id="performerLoad">Load Part</button>

        <select id="rehearsalMarkMenu" name="Rehearsal Marks">

            <option value="R0">Start</option>

            <option value="R2">R2</option>
            <option value="R3">R3</option>
            <option value="R4">R4</option>
            <option value="R5">R5</option>

        <button id="rehearsalMarkSeek">Goto Mark</button>

        <input type="checkbox" name="conductor?" id="conductorSelect" autocomplete="off">conductor?</select>
    </div>
